import React from 'react';
import styles from './style/noticeitem.module.scss';

interface NoticeItemProps {
    date: string;
    title: string;
    description: string;
    views: string;
    imgSrc: string;
}

const NoticeItem = ({ date, title, description, views, imgSrc } : NoticeItemProps) => {
    return (
        <div className={styles.noticeItem}>
            <div className={styles.noticeImage}>
                <img src={imgSrc} alt={title} />
            </div>
            <div className={styles.noticeContent}>
                <div className={styles.noticeDate}>{date}</div>
                <div className={styles.noticeTitle}>{title}</div>
                <div className={styles.noticeDescription}>{description}</div>
                <div className={styles.noticeViews}>{views}</div>
            </div>
        </div>
    );
};

export default NoticeItem;
